import LaptopImg from "../images/computer-1185626_1280.jpg";

const RegisterAd = () => {
  return (
    <div className="register-ad-container ml-20 mt-4">
      <div className="take-back-section">
        <h1 className="text-4xl">Take Back What's Yours</h1>
        <p>
          File your taxes with us today by scheduling a session with one of our
          tax professionals.
        </p>
        <button>
          Register <strong>Now</strong>
        </button>
      </div>
      <div
        className="laptop-img-container"
        style={{
          backgroundImage: "url(" + LaptopImg + ")",
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        {/* <img id="reg-img" src={LaptopImg} alt="img" /> */}
      </div>
    </div>
  );
};
export default RegisterAd;
